function upTo(el, tagName) {
    tagName = tagName.toLowerCase();

    while (el && el.parentNode) {
        el = el.parentNode;
        if (el.tagName && el.tagName.toLowerCase() == tagName) {
            return el;
        }
    }
    return null;
}



function cleanUpPage() {

    var labels = document.getElementsByClassName("filter-multi-select-item-label");
    for ( i = 0; i < labels.length; i++)
    {
    	// remove the sort tags "#X#"
    	var texts = labels[i].innerHTML.split("#");
    	labels[i].innerHTML = texts[ texts.length - 1];
    }
    var labels = document.getElementsByClassName("scsw-pd-property-value");
    for ( i = 0; i < labels.length; i++)
    {
    	// remove the sort tags "#X#"
    	var texts = labels[i].innerHTML.split("#");
    	labels[i].innerHTML = texts[ texts.length - 1];
    }
    if ( document.URL.includes("/intra")) {
        var header = document.getElementsByClassName("sc-header-intra");
        for ( i = 0; i < header.length; i++)
        {
            // special label for internal sales channel
            header[i].style.display = "block";
        }
    }
}

function cleanUpProperties( id)
{
    var panel = document.getElementById( id);
    if ( panel) {
        var labels = panel.getElementsByClassName("filter-active");
        for ( i = 0; i < labels.length; i++)
        {
            // remove the sort tags "#X#"
            var texts = labels[i].innerHTML.split("e");
            labels[i].innerHTML = texts[ texts.length - 1];
        }
    }
}


