/* Open */
function openOverlay(imageId) {

    if ( ! imageId || imageId == "")
        imageId = "scswImagePhoto";
        
    // imgFrom = document.getElementById("scswDetailImage");
    imgFrom = document.getElementById(imageId);
    imgTo = document.getElementById("scswOverlayImage");

    if (imgFrom && imgTo)
    {
        imgTo.style.display = "";
        imgTo.src = imgFrom.src;
        imgTo.alt = imgFrom.alt;
        imgTo.style.opacity = 1;
        overlay = document.getElementById("scswOverlay");
        overlay.style.height = "100%";
        document.getElementById("scswOverlayHeading").style.display = "";
    }
    document.getElementById("scswOverlayActions").style.display = "none";
    document.getElementById("scswOverlayRender3D").style.display = "none";
}

function makeRequest(method, url) {
    return new Promise(function (resolve, reject) {
        let xhr = new XMLHttpRequest();
        xhr.open(method, url);
        xhr.onload = function () {
            if (this.status >= 200 && this.status < 300) {
                resolve(xhr.response);
            } else {
                reject({
                    status: this.status,
                    statusText: xhr.statusText
                });
    }
        };
        xhr.onerror = function () {
            reject({
                status: this.status,
                statusText: xhr.statusText
            });
        };
        xhr.send();
    });
}

async function getSupportedCADFormats( partNumber) {
    
    var req = null;
    
    try {
        req = await makeRequest( "GET", "/shop/tpdataavailable/" + partNumber);
    } catch(e) {
        console.log(e);
        return;
    }
    json = JSON.parse( req);

    if ( json.partNumberAvailability.availability)
    {
        var dropDown = document.getElementById("scswCadFormats");

        if ( dropDown && dropDown.length === 0) {

            for ( var i = 0; i < json.cadFormatList.length; i++) {

                var cad = json.cadFormatList[i];
                if ( cad.deliveryMethod === 1) {

                    var elem = document.createElement("option");
                    elem.textContent = cad.cadFormatName;
                    elem.value = cad.cadFormatId;
                    dropDown.appendChild(elem);
			    }
			}
        }
    }
}

function writeDownloadEvent( uri)
{
    var xmlhttp = new XMLHttpRequest();
    xmlhttp.onreadystatechange=function() {
        /* nothing to do here */;
    }
    xmlhttp.open( "GET", uri, true);
    xmlhttp.send();
}

function downloadPermitted() {

    if ( document.URL.includes("/intra/")) {
        return true;
    }
    var request = new XMLHttpRequest();

    try {

        request.open("GET", "/shop/requestdownloadpermission", false);
        request.send(null);

        if (request.status === 200) {
            json = JSON.parse(request.responseText);
            return json.download_permitted;
        }
    } catch (e) {
        console.log(e);
    }
    return false;
}

function downloadCadFile(sender, partNumber, errText) {

    var res = null;

    /* download limit reached für this user? */
    if (!downloadPermitted()) {
        alert(errText);
        return res;
    }
    /* prevent user from clicking multiple times */
    sender.disabled = true;

    /* get the format ID */
    var dd = document.getElementById("scswCadFormats");
    var formatId = dd.options[dd.selectedIndex].value;
    var formatName = dd.options[dd.selectedIndex].text;

    var url = "https://ws.tracepartsonline.net/tpowebservices/DownloadCADPath?Language=de&PartNumber="
                + partNumber + "&ClassificationID=STEINCO_43605093&UserEmail=info@steinco.de&Format=json&Version=2&CADFormatID="
                + formatId + "&ApiKey=H3yCyUH4nM9AV7";

    try {

        var req = new XMLHttpRequest(); // a new request

        req.open("GET", url, false);
        req.send(null);

        if ( req.status != 404) {

            data = req.responseText;
            // console.log(cadFormats);

            json = JSON.parse( data);

            for ( i = 0; i < json.filesPath.length; i++)
            {
                if ( json.filesPath[i].type === 'Archive')
                {
                    // window.open(json.filesPath[i].path);
                    window.location.href = json.filesPath[i].path;

                    /* extract filename from URI.
                        The name is preceded by an "UTF-8''" and 
                        followed by an "&"
                        */
                    res = decodeURI(json.filesPath[i].path);
                    var file = res.substr( res.indexOf( "''") + 2);
                    file = file.substr( 0, file.indexOf("&"));

                    /* write an event table record */
                    var uri = "/shop/registercustomerevent/"
                                + partNumber
                                + "?filename="
                                + file
                                + "&format="
                                + formatName
                                + "&relay=0&type=0";
                        
                    writeDownloadEvent( encodeURI( uri));
                    sender.disabled = false;
                }
            }
        }
    }
    finally{
        sender.disabled = false;
        return res;
    }
}
function async( func, callback) {
    setTimeout(function() {
        func();
        if (callback) {callback();}
    }, 0);
}

var cadFormats = "";

function showOverlay3D( prodId, errText) {

    // document.getElementById("scswOverlayImage").style.opacity = 0;
    document.getElementById("scswOverlayActions").style.display = "";
    document.getElementById("scswOverlayRender3D").style.display = "";

    /* // make the 3D rendering full screen
    container = document.getElementById("scswOverlayImageContainer");
    container.setAttribute("style", "top: 0");
    container.setAttribute("style", "width: 100%");
    container.setAttribute("style", "height: 100%");
    */
    iFrame = document.getElementById("scswOverlayRender3D");

    if (iFrame) {

        iFrame.src = "https://www.traceparts.com/els/steinco/en/api/viewer/3d?SupplierID=STEINCO_43605093&PartNumber=" + prodId + "&SetBackgroundColor=0xFFFFFF&SetRenderMode=shaded&DisplayGroundGrid=false&EnableMirrorEffect=false&EnablePresentationMode=false";

    }
}

function openOverlay3D( prodId, errText) {

    overlay = document.getElementById("scswOverlay");
    overlay.style.height = "100%";
    document.getElementById("scswOverlayImage").style.display = "none";
    document.getElementById("scswOverlayHeading").style.display = "";

    getSupportedCADFormats( prodId);
    showOverlay3D( prodId, errText);
}

/* Close */
function closeOverlay() {
    document.getElementById("scswOverlayHeading").style.display = "none";
    document.getElementById("scswOverlay").style.height = "0%";
    document.getElementById("scswOverlayRender3D").src = "";
}

/* slide navbar */
var wrapper = $('#page-wrapper'),
        menu = $('.menu'),
        menuLinks = $('.menu ul li a'),
        toggle = $('.nav-toggle'),
        toggleIcon = $('.nav-toggle span');
function toggleThatNav() {
    menu.hasClass('show-nav')
            ? (menu.removeClass('show-nav'), toggle.removeClass('show-nav'))
            : (menu.addClass('show-nav'), toggle.addClass('show-nav'));
}
function changeToggleClass() {
    toggleIcon.toggleClass('fa-times'), toggleIcon.toggleClass('fa-bars');
}
$(function () {
    toggle.on('click', function (a) {
        a.stopPropagation(), a.preventDefault(), toggleThatNav(), changeToggleClass();
    }),
            wrapper.on('click', function (a) {
                menu.hasClass('show-nav') &&
                        (menu.removeClass('show-nav'), toggle.removeClass('show-nav'), changeToggleClass());
            });
});

function togglePanel(e) {

    if (!e)
        e = window.event;
    var sender = e.srcElement || e.target;

    var x = document.getElementById("togglePanel");
    if (x.style.display === "none") {
        x.style.display = "";
        sender.setAttribute("aria-expanded", "true");
    } else {
        x.style.display = "none";
        sender.setAttribute("aria-expanded", "false");
    }
}

function checkForReload()
{
    /* product detail pages have to reload on "history back" to
        proper handle the customer logged in / not logged in status.
        This is needed for the CAD file downloads.
        */
    if ( document.getElementById("sc-productDetailPage") != null) {

        if ( performance.getEntriesByType("navigation")[0].transferSize === 0)
        {
            // page contents have been cached
            window.location.reload( true); 
        }
    }
}

checkForReload()
